const char* getNamedResource (const char* resourceNameUTF8, int& numBytes);
const char* getNamedResource (const char* resourceNameUTF8, int& numBytes)
{
    unsigned int hash = 0;

    if (resourceNameUTF8 != nullptr)
        while (*resourceNameUTF8 != 0)
            hash = 31 * hash + (unsigned int) *resourceNameUTF8++;

    switch (hash)
    {
        case 0x3c71eb84:  numBytes = 1839; return noise_png;
        case 0x54c4b020:  numBytes = 4481; return rainbow_png;
        case 0x8c6a70e2:  numBytes = 4514; return solidColor_png;
        case 0xcb10de0b:  numBytes = 5621; return strobe_png;
        case 0x6ab746f9:  numBytes = 3170; return dmx_png;
        case 0x7348e9e1:  numBytes = 3119; return multipoint_png;
        case 0x42f5be6c:  numBytes = 3682; return node_png;
        case 0xb42a8f68:  numBytes = 3156; return picture_png;
        case 0x5d45eefa:  numBytes = 2756; return point_png;
        case 0xcdd754b5:  numBytes = 2116; return script_png;
        case 0x576fad2b:  numBytes = 1253; return timeline_png;
        case 0x4f784065:  numBytes = 6004; return video_png;
        case 0x7448d63a:  numBytes = 2458; return default_btlayout;
        case 0x78c8c9ab:  numBytes = 1868; return fadeIn_png;
        case 0xeac7f79c:  numBytes = 392; return fadeOut_png;
        case 0xd4093963:  numBytes = 98974; return icon_png;
        case 0x6e00bb0a:  numBytes = 675; return new_png;
        case 0x893e7e0c:  numBytes = 975; return shader_frag;
        default: break;
    }

    numBytes = 0;
    return nullptr;
}

